import React from 'react';

const Header = ({ isLoggedIn, onSignIn, onSignOut }) => {
    return ( <
        header className = "bg-white shadow-md p-4 mb-8" >
        <
        div className = "container mx-auto flex justify-between items-center" >
        <
        h1 className = "text-2xl font-bold text-indigo-600" > FARMERS < /h1> <
        div className = "flex items-center space-x-4" >
        <
        nav >
        <
        ul className = "flex space-x-4" >
        <
        li > < a href = "#"
        className = "text-gray-600 hover:text-indigo-600 font-medium" > Home < /a></li >
        <
        li > < a href = "#"
        className = "text-gray-600 hover:text-indigo-600 font-medium" > About < /a></li >
        <
        li > < a href = "#"
        className = "text-gray-600 hover:text-indigo-600 font-medium" > Services < /a></li >
        <
        /ul> <
        /nav> {
            isLoggedIn ? ( <
                button onClick = { onSignOut }
                className = "bg-red-500 text-white font-semibold py-2 px-4 rounded-full shadow-md hover:bg-red-600 transition-colors duration-300" >
                Sign Out <
                /button>
            ) : ( <
                button onClick = { onSignIn }
                className = "bg-indigo-600 text-white font-semibold py-2 px-4 rounded-full shadow-md hover:bg-indigo-700 transition-colors duration-300" >
                Sign In <
                /button>
            )
        } <
        /div> <
        /div> <
        /header>
    );
};

export default Header;
